#include <bits/stdc++.h>
using namespace std;

// find the minimum length substring in given string s such that all 
// the characters of another string t appear atleast once in the string s


// sliding window concept



bool compareMaps(unordered_map<char, int> a, unordered_map<char, int> b)
{
    for(auto it: b)
    {
        if(it.second > a[it.first])
            return false;
    }
    return true;
}

string minWindow(string s, string t)
{
    unordered_map<char, int> b;
    int m = s.size();
    int n = t.size();
    for (int i = 0; i <= n - 1; i++)
    {
        b[t[i]]++;
    }

    unordered_map<char, int> a;

    int i = 0;
    int j = 0;
    int minLength = INT_MAX;
    int startPoint = -1;

    for (; i <= m - 1; i++)
    {
        a[s[i]]++;

        while (compareMaps(a, b) && j <= i)
        {
            int length = i - j + 1;
            if(length < minLength)
            {
                minLength = length;
                startPoint = j;
            }

            a[s[j++]]--;
        }
    }

    if (startPoint == -1)
        return "";

    return s.substr(startPoint, minLength);
}

int main()
{

    string str = "";

    string t = "";


    cout<<minWindow(str, t);
}